import './App.css';
import { Component } from 'react';
import { Router, Route, Navigate , Routes } from 'react-router-dom';
import ChatPage from './Chat';

class App extends Component {

  state = {
    token: null
  }

  render() {
    return (
      <Router>

          <Navigate from="/" to="/chat" exact />
          <Navigate to="/chat" exact />
          <Route path="/chat" component={ChatPage} exact />

      </Router>
    );
  };
}

export default App;
